INSERT INTO `patients` VALUES ('3', 'Rajesh', 'Subbu', 'AB+', 'Dengue', '34', '05/06/1984', 'Male', '9535866270', 'tmksmanju13@gmail.com', 'Bangalore', 'Rajajinagar,bangalore', '560001', 'dengue.txt', 'Symptoms include high fever, headache, rash and muscle and joint pain. In severe cases there is serious bleeding and shock, which can be life threatening.', '-7015e890eeb43a5e55f03417aa258c8ac7b13d7', '07/12/2018   17:32:25', '2', '170');
INSERT INTO `patients` VALUES ('4', 'Rajesh', 'Manish', 'A+', 'Cancer', '23', '12/12/1995', 'Male', '9535866270', 'tmksmanju13@gmail.com', 'Bangalore', '#3433,2nd Block,Rajajinagar', '560021', 'cancer.txt', 'ASCO developed two types of forms to help people diagnosed with cancer keep track of the treatment they received and medical care they may need in the future: a Cancer Treatment Plan and a Survivorship Care Plan. A Cancer Treatment Plan is a form that provides a convenient way to store information about your cancer, cancer treatment, and follow-up care. It is meant to give basic information about your medical history to any doctors who will care for you during your lifetime. A Survivorship Care Plan is a form that contains important information about the given treatment, the need for future check-ups and cancer tests, the potential long-term late effects of the treatment you received, and ideas for improving your health.', '-7c04613090c1dc1de7fe5c285c231cbb06cba667', '07/12/2018   17:33:18', '2', '120');
INSERT INTO `patients` VALUES ('5', 'Manjunath', 'Shoba', 'B+', 'Cancer', '45', '19/12/1973', 'Male', '9535866270', 'tmksmanju13@gmail.com', 'Bangalore', '#3433,2nd Block,Malleshwaram', '560040', 'cancer1.txt', 'ASCO developed two types of forms to help people diagnosed with cancer keep track of the treatment they received and medical care they may need in the future: a Cancer Treatment Plan and a Survivorship Care Plan. A Cancer Treatment Plan is a form that provides a convenient way to store information about your cancer, cancer treatment, and follow-up care. It is meant to give basic information about your medical history to any doctors who will care for you during your lifetime. A Survivorship Care Plan is a form that contains important information about the given treatment, the need for future check-ups and cancer tests, the potential long-term late effects of the treatment you received, and ideas for improving your health.\r\n', '688822f5c22b58ded98e481b8030b334dd1992b3', '07/12/2018   17:52:33', '4', '180');
